import React from 'react';
import logo from './800px-Chess_Cet45.svg.png';
import './App.css';

function App() {
  return (
    <div className="App">
        <div className='black'>1</div>
        <div className='white'>2</div>
        <div className='black'>3</div>
        <div className='white'>4</div> 
        <div className='black'>5</div>
        <div className='black'>6</div>
        <div className='black'>7</div>
        <div className='black'>8</div>
    </div>
  );
}

export default App;
